@CercaniasMadridbuenas. Exactamente cuánto le queda al tren que va a pasar por Embajadores directamente Humanes/Fuenlabrada?
Porque hace 10 min le quedaban 25, y acaban de decir que le quedan 25 todavía... 
Llevamos a lo tonto 40 min esperando

@CercaniasMadridHola
Parece que entre los andenes 5 y 6 de Atocha alguien practicó el "apretoning" y plantó ahí el producto de su alumbramiento. Por su estado momificado, lleva ahí sus muchas buenas horas. 
Dejó una nota, pero está en blanco; quizá justo llegó su tren. ¡Gracias!

